import React, { PureComponent } from 'react';
import Navbar from './Navbar';
import Footer from './Footer';

export default class Layout extends PureComponent {
    render() {
        return (
            <React.Fragment>
                <Navbar />
                <div style={{ overflow: 'scroll' }}>{this.props.children}</div>
                {/* <Footer /> */}
            </React.Fragment>
        );
    }
}
